class Solution {
public:
    int maxOperations(string s) {
        int n = s.size();
        int i;
        int res = 0;
        int cnt = 0;
        for(i=0;i<n-1;i++){
            if(s[i]=='1'){
                cnt++;
                if(s[i+1]=='0') res+=cnt;
            }
        }

        return res;
    }
};
